import React from 'react'
import SearchList from './Components/SearchList'

class App extends React.Component {

    constructor(){
        super()
        this.state = {
            searches: []
        }
    }

    render() {
        return (
            <div className = "app">
                {this.props.messages.map((message, index) => {
                    return (
                        <SearchList searches = {this.state.searches}/>
                    )
                })}
            </div>
        );
    }
}

export default App
